INSERT INTO `articles` VALUES ('20', '广州市新规：每套房只能买一个车位 不得“只售不租”', 'https://wpimg.wallstcn.com/17480863-f2b0-48c8-b0cc-fd8f0dd5ffa6.jpg', '2019-05-20', '5月23日，广州市住建委官网发布《广州市房地产开发项目车位和车库租售管理办法》，其中指出住宅建筑区划内，规划用于机动车停放的车位、车库尚未出售的，建设单位应当予以出租。不得以“只售不租”等名义拒绝提供停车服务。此外，在车位数量未超过本建筑区划内房屋套数的情况下，建筑区划内业主每购买一套房屋，只能相应购买一个车位或车库。', '0', '草稿', '管理员', '433', '1');
