INSERT INTO `articles` VALUES ('40', '全球债市大幅反弹！10年期美债收益率创一年半新低 关键美债收益率再度倒挂', 'https://wpimg.wallstcn.com/c68ad648-9a18-40cc-bf0b-a27a1a69b13c.jpg', '2019-05-21', '贸易不确定性、欧洲经济疲软、英国脱欧等共同推动了投资者对避险资产的需求。美国国债价格攀升，10年期美债收益率周四下跌至2017年来最低水平。此外，今日盘中，3个月期美债收益率涨超了一年期、两年期、五年期和10年期美债收益率，同时，一年期收益率也涨超了两年期、五年期美债收益率。而欧债同样上涨。德国10年期基准国债收益率下跌3.4个基点，报-0.12%，5月15日盘中曾走软至-0.132%、创2016年9月30日以来盘中最低位。', '0', '草稿', '管理员', '859', '1');
