INSERT INTO `articles` VALUES ('65', '美股周五涨 但本周连续第五周下跌 百度本周大跌30% 英镑上涨', 'https://wpimg.wallstcn.com/91dafeaa-249f-4d05-ac0f-ce10f663ca09.jpg', '2019-05-22', '美股下周一休市，今日交易清淡，集体上涨。本周，美股连续第五周下跌，创2011年来最长下跌周期。周五，标普涨0.15%，道指涨近百点，纳指涨0.11%。英国首相May宣布辞职，英镑上涨，美债收益率上行，美元下跌。油价昨日大跌超5%后今日收涨超1%。特斯拉跌2.5%，中芯国际跌4.7%，该公司主动申请在纽交所退市。离岸人民币北京时间04:59报6.9166元，较周四纽约尾盘涨101点。', '0', '草稿', '管理员', '935', '4');
INSERT INTO `articles` VALUES ('66', '特朗普的第二轮农业补贴来了 160亿美元较首轮增加三分之一 ', 'https://wpimg.wallstcn.com/17044bc5-6cb9-4bfb-aff7-eafb602717a9.jpg', '2019-05-22', '第一轮75%以上的直接补贴都给了豆农，第二轮不再按作物补贴。美国玉米期货周四终结八日连涨，今年玉米播种速度六年最慢。外界担心，在大豆供应创纪录时，补贴可能促使农户舍弃玉米，加种大豆。', '0', '草稿', '管理员', '725', '3');
