INSERT INTO `articles` VALUES ('124', '马斯克一封邮件终结六连跌！特斯拉创七日最大涨幅 盘中涨超3% ', 'https://wpimg.wallstcn.com/74c1cb35-aa24-4cae-ac13-d40f418f8141.jpg', '2019-05-25', '有风投预计特斯拉今年交货量将低于其最低销售目标，盘前特斯拉跌近5%。传出马斯克邮件消息后，特斯拉周四走高，收涨逾1.4%，截至周三连续四日创近两年半新低，今年以来跌近40%。', '0', '草稿', '管理员', '948', '1');
INSERT INTO `articles` VALUES ('125', '深交所：谴责深大通拒不配合证监会依法履职的行为', 'https://wpimg.wallstcn.com/5da942dc-3d87-4a34-aece-3a133ca85d13.jpg', '2019-05-25', '上市公司及相关方必须谨记和坚持“四个敬畏”的要求，敬畏市场、敬畏法治、敬畏专业、敬畏投资者，守法经营、合规发展，尤其是大股东、实际控制人和上市公司董监高应当常怀敬畏之心，给投资者一个真实、透明、合规的上市公司，共同促进资本市场稳定健康发展。', '0', '草稿', '管理员', '757', '4');
INSERT INTO `articles` VALUES ('126', '美国5月Markit制造业和服务业PMI惨淡 前者创近十年新低', 'https://wpimg.wallstcn.com/d052b608-2cb2-418a-8e4b-04fc7dbcb87e.png', '2019-05-25', '美国5月Markit服务业PMI初值降至50.9，大幅低于预期的53.5，创2016年2月以来新低。其中，新商业分项指数降至2016年3月以来新低。美国5月Markit制造业PMI初值也降至50.6，不及预期的52.7，创2009年来新低。', '0', '草稿', '管理员', '656', '2');
