INSERT INTO `articles` VALUES ('152', '特斯拉削减成本有多认真？连卫生纸都不放过！', 'https://wpimg.wallstcn.com/41451f8e-a969-4784-95c5-75228ab621cc.png', '2019-05-26', '免费午餐、便捷的班车和喝不完的精品咖啡，硅谷大公司往往以令人羡慕的员工福利而闻名。不过，特斯拉似乎选择反其道而行。现在，特斯拉的部分员工将无法获得免费的卫生厕纸。这迫使一些员工从家里带来卫生纸，以帮助特斯拉减少开销。', '0', '已发布', '管理员', '755', '1');
