INSERT INTO `articles` VALUES ('156', '小扎首次回应分拆Facebook：解决不了问题 半年清理34亿虚假账户', 'https://wpimg.wallstcn.com/284c02d3-fa0b-4550-a2a5-b5f2128ac448.jpg', '2019-05-26', '扎克伯格屡冒金句。他认为，“分拆只会令遏制虚假账户和有害新闻的行动更为困难，因此分拆Facebook解决不了问题”，同时，Facebook拨给改善安全问题的预算花费“比竞争对手推特一整年的营收还多”。', '0', '已发布', '管理员', '912', '3');
INSERT INTO `articles` VALUES ('157', '供给被砍3成且对手永久停产，行业格局被彻底颠覆，这个品种淡季价格一路狂飚，龙头今年业绩10倍以上提升——0523脱水研报', 'https://wpimg.wallstcn.com/aa9527f9-1d8a-4343-bd82-954ecf65da07.jpg', '2019-05-26', '1、70%产品被召回，它成最大赢家，价格10年新高+产能顺势扩张80%抢市场，复制海外同行转型千倍增长奇迹；2、高位跳涨，淡季价格逼近历史新高！这个短中长都有催化的火热行业还能再涨50%？3、价格火箭般狂飙，2000、4000一路猛蹿，且一再突破防线，龙头业绩弹性10倍提升；4、行业洗牌前夜，即使最悲观的情况都能盈利，熬过这个冬天就是剩者为王？', '0', '已发布', '管理员', '295', '4');
INSERT INTO `articles` VALUES ('158', '沃尔玛一季度电子商务同比增长37% 同店销售9年最佳 盘中最大涨幅超4%', 'https://wpimg.wallstcn.com/fbf6790a-7c70-4797-9493-95d78612c2ff.png', '2019-05-26', '沃尔玛一季度财报好于分析师预期，主要受益于电子商务收入同比增长37%。一季度，其美国同店销售增长3.4%，创9年来最佳表现。但一季度，沃尔玛的海外销售下跌4.9%，其CFO Brett Biggs表示，关税的提高将导致售价的上涨。受此消息推动，周四早盘沃尔玛股价一度涨逾4%，最高触及103.96美元；截至收盘，上涨1.4%，至101.31美元。', '0', '草稿', '管理员', '300', '3');
