INSERT INTO `articles` VALUES ('205', '索罗斯入股！资管公司GAM股价大涨15%', 'https://wpimg.wallstcn.com/69afb001-1f89-4da0-8505-440ec9ac7256.png', '2019-05-28', '金融大鳄、亿万富豪索罗斯（George Soros）透露持有陷入困境的瑞士资管公司 GAM Holding 3%的股份。受此消息推动，周五股价收涨15%。去年7月，受其明星基金经理人丑闻影响，GAM曾遭投资人撤资280亿美元，股价下跌70%。', '0', '已发布', '管理员', '528', '5');
