INSERT INTO `articles` VALUES ('209', '市场再现恐慌 科技股拖累美股重挫 油价暴跌5% 美债收益率大幅下行', 'https://wpimg.wallstcn.com/4b79e5f4-dc8e-4328-8972-0727ffa8df99.jpg', '2019-05-28', '科技股重挫，标普盘中跌1.7%，收跌1.19%，道指盘中跌超400点，收跌约286点，纳指盘中跌2%，收跌1.58%。美油大跌超5%。10年期美债收益率跌8.5个基点，盘中触及2017年来新低，关键美债收益率曲线倒挂。日元、黄金上涨。英伟达跌3.2%，博通、AMD跌近4%，高通跌1.5%。阿里巴巴跌1.7%；京东跌5.4%；百度跌超4%。新浪跌10%，微博跌11%。', '0', '已发布', '管理员', '457', '1');
INSERT INTO `articles` VALUES ('210', '富时罗素宣布纳入1097只A股 将带来百亿美元资金净流入', 'https://wpimg.wallstcn.com/f6a00752-3761-424e-bd6c-d49971fa3900.jpg', '2019-05-28', '北京时间5月25日凌晨，富时罗素公布了其全球股票指数系列2019年6月的季度变动，其中包括了纳入其全球股票指数系列的A股名单，这次变动将于2019年6月21日收盘后正式生效。名单显示，共有1097只A股入选，其中包括292只大盘股、422只中盘股、376只小盘股以及7只微盘股。文件显示，第一阶段完成后，A股将占到富时罗素新兴市场比重的5.57%，“入富”第一阶段将带来100亿美元净被动资金流入。', '0', '已发布', '管理员', '713', '1');
INSERT INTO `articles` VALUES ('211', '隔夜五张图：美股创八年最长下跌周期  美元贸易加权指数逼近十七年高位 英镑终于扭转跌势？', 'https://wpimg.wallstcn.com/a56596c7-f02e-4fb4-b7f3-666b472a69f9.jpg', '2019-05-28', '美国三大指数集体反弹，但未能改变创八年来最长周度连跌命运；May宣布6月7日正式辞职，英镑上涨，终结此前连跌趋势？执政党印度人民党大选获胜，印度股市一度创新高，NSE波动性创5年最大跌幅；美元指数连跌两日，美元贸易加权指数逼近十七年高位；铁矿石：风景这里独好，夜盘收涨近3%。', '0', '草稿', '管理员', '678', '4');
